description:
The Seven Stages of Transformation

&quot;Seven Stages of Alchemical Transformation consists of seven hypnosis CDs - each one guiding you through meditation related to specific stage of inner alchemical transformation.

The language used on these recordings is simple, straightforward and easy to understand, so you can benefit from these recordings, regardless of your previous experience and understanding of alchemical symbolism. All references to alchemical symbolism are explained - and while previous knowledge related to Western Alchemy is not necessary to follow this program, it is nevertheless designed for people genuinely interested in spiritual growth and inner transformation. In that respect, this Alchemical program does require one's willingness to fully and completely embrace spiritual worldview.&quot;
